  return (
    <div>
      <Nav></Nav>
      <div className="bg-black h-[50vh]"></div>
      <Button variant="primiary" className="p-[20px] bg-[yellow]">
        dasdsa
      </Button>

      <Typography.Title>sdadsa</Typography.Title>
    </div>
  );
}

export default App;
